    async def get_waw_placing_tables(
        self,
        event_id: Union[Optional[int], UnsetType] = UNSET,
        order_by: Union[Optional[PlacingTableOrderBy], UnsetType] = UNSET,
        order_direction: Union[Optional[OrderDirectionEnum], UnsetType] = UNSET,
        **kwargs: Any
    ) -> GetWawPlacingTables:
        query = gql(
            """
            query GetWawPlacingTables($eventId: Int, $orderBy: PlacingTableOrderBy, $orderDirection: OrderDirectionEnum) {
              getWawPlacingTables(
                eventId: $eventId
                orderBy: $orderBy
                orderDirection: $orderDirection
              ) {
                id
                updatedOn
                hash
                eventId
                rank
                countryName
                countryCode
                gold
                silver
                bronze
                forth
                fifth
                sixth
                seventh
                eighth
                points
                tableOrder
                eventId_WA
                subCategoryCode
              }
            }
            """
        )
        variables: Dict[str, object] = {
            "eventId": event_id,
            "orderBy": order_by,
            "orderDirection": order_direction,
        }
        response = await self.execute(
            query=query,
            operation_name="GetWawPlacingTables",
            variables=variables,
            **kwargs
        )
